import { useHistory } from 'react-router-dom';

function Prueba() {
  const history = useHistory();

  // Función para manejar el inicio de sesión
  const handleLogin = () => {
    // Lógica de inicio de sesión...

    // Después de iniciar sesión exitosamente, redirige a la página principal
    history.push('/prueba');
  };

  return (
    // Contenido de tu página de inicio de sesión
    // Un formulario de inicio de sesión, por ejemplo
    <div>
      <h2>Login Page</h2>
      {/* Botón o formulario para iniciar sesión */}
      <button onClick={handleLogin}>Login</button>
    </div>
  );
}

export default Prueba;
